  const { list, status } = products;
  console.log(products)

  return (
    <Container>
      <h1 className='h2'>All products</h1>
      <SortingBlock />
      {/* { status !== 'ready' && <div>Sorry, something went wrong... please try it again</div>} */}
      <div className='cards_container'>
        {list?.filter(el => el.show_product)
          .map(el => <ProductCard key={el.id} {...el} />)
        }
      </div> 
    </Container>
  )
}
